酸，肝虚孕妇最喜食，故称益母果或益母子。柠檬中含有丰富的柠檬酸，因此被誉为“柠檬酸仓库”；因为味道特酸，故只能作为上等调味料，用来调制饮料菜肴、化妆品和药品。',5,0),(378,356,49,'墨西哥牛油果',2,0,0,5,1,3,NULL,'牛油果有一个很大的果核，果肉为黄绿色，味如牛油，被称为“森林的牛油”，果肉含有多种不饱和脂肪酸，所以有降低胆固醇的功效，另外牛油果所含的维生素、也算对美容保健也很有效果。',5,0),(379,356,17,'西州哈密瓜',1,0,0,1,1,1,NULL,'哈密瓜热量很低，低脂肪，附有丰富的营养物质，如维生素及其矿物质。它能够满足人体每天维生素A及其维生素C的需要，而且提供其他贵重矿物质，如钾及其叶酸。',5,0),(380,356,20,'沙田柚',1,0,0,25,2,1,NULL,'柚子还具有健胃、润肺、补血、清肠、利便等功效，可促进伤口愈合，对败血症等有良好的辅助疗效。',5,0),(381,391,18,'周至亚特猕猴桃',1,18,18,9982,2,3,NULL,'原产地亚特猕猴桃',5,0),(382,356,23,'香蕉',1,0,0,35,2,1,NULL,'香蕉的营养非常丰富，每百克果肉中含蛋白质1.2克，脂肪0.5克，碳水化合物19.5克，钙9毫克，磷31毫克，铁0.6毫克，还含有胡萝卜素、硫胺素、烟酸、维生素C、维生素E及丰富的微量元素钾等。',5,0),(383,356,18,'佳沛绿心奇异果',2,0,0,30,2,1,NULL,'每100克新鲜奇异果肉含有100毫克～300毫克维他命Ｃ，奇异果的膳食纤维含量是菠萝的1.7倍，维他命Ｅ含量是樱桃的２倍，抗氧化剂含量是番茄的3.3倍，钙含量是苹果的６倍、香蕉的４倍。',5,0),(384,356,58,'蓝莓',1,0,0,12,3,1,NULL,'蓝莓果实含有丰富的营养成分，属高氨基酸、高锌、高钙、高铁、高铜、高维生素的营养保健果品。它不仅具有良好的营养保健作用，还具有防止脑神经老化、强心、抗癌、软化血管、增强人的肌体免疫等功能。',5,0),(385,356,59,'西梅',2,0,0,25,2,1,NULL,'西梅，来自美国加州，也称为加州梅。西梅含有丰富的维生素A及纤维素，同时兼含铁和钾等矿物质，却不含脂肪和胆固醇。西梅可帮助老年人补充铁、锌、钾，强身健骨，可使小孩增加各种维生素。',5,0),(386,356,51,'油桃',2,0,0,20,2,1,NULL,'油桃有补益气血、养阴生津的作用，尤其适合大病之后，气血亏虚，面黄肌瘦，心悸气短者食用。油桃的含铁量较高，是缺铁性贫血病人的理想辅助食物，另外，油桃含钾多，含钠少，适合水肿病人食用',5,0),(387,356,53,'红提',2,0,0,18,2,1,NULL,'提子的果肉、果皮，甚至核，都蕴藏着丰富的营养素，可谓全身都是宝。它含有17%以上的葡萄糖和果糖，0.5%-1.5%的苹果酸、洒石酸、柠檬酸等，含有多种维生素和氨基酸。',5,0),(388,356,42,'释迦',2,0,0,5,1,1,NULL,'台湾释迦这种水果的果肉是乳白色的味道香甜，而且它里面维生素A、B、C等的含量都很高，同时蛋白质铁、钙等物质也是它最重要的营养成分，人们食用以后不但能吸收大量营养，还能起到帮助消化的作用呢。',5,0),(389,356,3,'枇杷芒',2,0,0,2,2,3,NULL,'泰国枇杷芒，是近年来研发而出的新兴芒果种类。产地泰国东南临太平洋，西南濒安达曼海。热带季风气候，四季如春，孕育出丰富多样的鲜果。枇杷芒看似枇杷，口感确是芒果的清香润滑。',5,0),(390,444,14,'海南千禧',1,1,10,5,3,3,'http://shopimg.qiniudn.com/add:1426149328.0927086:0','一咬入口，肉厚、脆爽、多汁，清香的甜且果味十足，十分爽口！\n一个接一个停不住手，一碗一会会就没了！',5,1),(391,356,8,'青啤梨',2,0,0,30,2,5,NULL,'青啤梨含有大量果糖，可迅速被人体吸收，其中钾可以维持人体细胞与组织的正常功能，可调节血压；维他命C可以保护细胞、增强白血球活性、有利铁质吸收、加速伤口愈合，而果胶是可溶性纤维，能有效降低胆固醇。',5,0),(392,443,1,'梨子',1,0,23,10,1,5,NULL,'测试',5,0),(393,356,1015,'柿饼',1,0,0,1,3,5,'http://shopimg.qiniudn.com/add:1426150602.6902416:0','韩国合心柿饼，甜而不腻，好吃到爆。',5,1),(394,453,1,'砂糖桔',1,0,0,50,2,1,'http://shopimg.qiniudn.com/add:1426152980.755418:0','沙糖桔，含有丰富的维生素 C、钙、纤维质、少量蛋白质、脂肪以及丰富的葡萄糖、果糖、蔗糖、苹果酸，枸椽酸、柠檬酸以及胡萝卜素、硫胺素，核黄素、尼克酸、抗坏血酸，以及钙、磷、镁、钠等人体必需的元素。',5,0),(395,453,1,'脐橙',1,0,0,50,2,1,'http://shopimg.qiniudn.com/fruit:1426153490.4400148:395','脐橙是世界各国竟相栽培的柑桔良种。脐橙营养丰富，含有人体所必需的各类营养成份。',5,0),(396,453,1,'沙田柚',1,0,0,80,2,1,'http://shopimg.qiniudn.com/fruit:1426153514.3779924:396','有止咳平喘、清热化痰、健脾消食、解酒除烦的作用。 有理气化痰宽中、健脾消食、散寒燥湿的作用，并可烹调成菜或制作蜜饯，有消炎、镇痛、利湿、提神醒脑等功效，治乳腺炎、关节疼痛和头风病等病症。',5,0),(397,453,1,'贡梨',1,0,0,100,2,1,'http://shopimg.qiniudn.com/add:1426153462.9116864:0','由乾隆皇帝降下圣旨，封砀山梨为贡品。砀山贡梨果实硕大，黄亮美观。皮薄多汁、味浓甘甜，生吃可清六腑之热，熟吃可滋五脏之阴。',5,0),(398,453,1,'皇冠梨',1,0,0,80,2,1,'http://shopimg.qiniudn.com/add:1426153572.898194:0','含有一定量的蛋白质、脂肪、胡罗卜素、维生素B1、维生素B2、苹果酸等，这些都是人体必需的物质。',5,0),(399,453,1,'香梨',1,0,0,80,2,1,'http://shopimg.qiniudn.com/add:1426153759.9323225:0','香梨，维吾尔语叫“奶西姆提”。其特点是香味浓郁、皮薄、肉细、汁多甜酥、清爽可口，系梨之上品。',5,0),(400,453,1,'火龙果',1,0,0,80,2,1,'http://shopimg.qiniudn.com/add:1426153864.5522249:0','火龙果营养丰富、功能独特，它含有一般植物少有的植物性白蛋白以及花青素，丰富的维生素和水溶性膳食纤维。火龙果属于凉性水果，在自然状态下，果实于夏秋成熟，味甜，多汁。',5,0),(401,453,1,'龙眼',1,0,0,50,2,1,'http://shopimg.qiniudn.com/add:1426153936.0686417:0','补心脾，益气血，健脾胃，养肌肉。思虑伤脾，头昏，失眠，心悸怔忡，虚赢，病后或产后体虚，及由于脾虚所致之下血失血症。 现代医学实践证明 ，它还有美容、延年益寿之功效。',5,0),(402,450,1,'雪梨',1,0,22,222,1,5,'http://shopimg.qiniudn.com/fruit:1426154115.47805:402','真好吃啊真好吃',1,0),(403,453,1,'牛奶蜜枣',1,0,0,100,2,1,'http://shopimg.qiniudn.com/add:1426153993.1254637:0','果实营养丰富，脆甜可口，含有大量维生素C、钙、磷、维生素B、胡萝卜素等，素有“维生素丸”之称，有“日食三枣，长生不老”之说。由于其果形优美而具苹果、梨、枣的风味',5,0),(404,453,1,'西州密瓜',1,0,0,60,2,1,'http://shopimg.qiniudn.com/add:1426154174.952895:0','表皮深绿、淡绿或者是微黄，网纹深浅不一，果肉厚质，中心橘红，越往中心甜度越高，爽嫩细滑，果香浓郁。',5,0),(405,453,1,'猕猴桃',1,0,0,30,2,1,'http://shopimg.qiniudn.com/add:1426154230.0888033:0','品质鲜嫩，营养丰富，风味鲜美，人们喜食的水果，有美容养颜的效果，延迟皮肤衰老的作用，深受各年龄人的喜爱。',5,0),(406,453,1,'特级圣女果（黄皮）',1,0,0,50,2,1,'http://shopimg.qiniudn.com/add:1426154304.69391:0','圣女果，又称小西红柿。在国外又有“小金果”、“爱情之果”之称。它既是蔬菜又是水果，不仅色泽艳丽、形态优美 ，而且味道适口、营养丰富，除了含有番茄的所有营