素A及纤维素，同时兼含铁和钾等矿物质，却不含脂肪和胆固醇。西梅可帮助老年人补充铁、锌、钾，强身健骨，可使小孩增加各种维生素。',5,0),(105,51,'新西兰青啤梨',1,0,0,20,2,5,'http://shopimg.qiniudn.com/add:1426153956.0109148:0','青啤梨含有大量果糖，可迅速被人体吸收，其中钾可以维持人体细胞与组织的正常功能，可调节血压；维他命C可以保护细胞、增强白血球活性、有利铁质吸收、加速伤口愈合，而果胶是可溶性纤维，能有效降低胆固醇。',5,0),(106,51,'释迦',1,0,0,5,1,1,'http://shopimg.qiniudn.com/add:1426154131.0793645:0','台湾释迦这种水果的果肉是乳白色的味道香甜，而且它里面维生素A、B、C等的含量都很高，同时蛋白质铁、钙等物质也是它最重要的营养成分，人们食用以后不但能吸收大量营养，还能起到帮助消化的作用呢。',4,0),(107,51,'红提',1,0,0,25,2,1,'http://shopimg.qiniudn.com/add:1426154649.8787744:0','提子的果肉、果皮，甚至核，都蕴藏着丰富的营养素，可谓全身都是宝。它含有17%以上的葡萄糖和果糖，0.5%-1.5%的苹果酸、洒石酸、柠檬酸等，含有多种维生素和氨基酸。',5,0),(108,51,'黑提',1,0,0,15,2,1,'http://shopimg.qiniudn.com/add:1426155470.9932473:0','黑提中含的类黄酮是一种强力抗氧化剂，可抗衰老，并可清除体内自由基。在提子中含有一种抗癌向量元素，可以防止健康细胞癌变并能防止癌细胞扩散。',5,0),(109,55,'杨梅',1,0,0,60,3,1,'http://shopimg.qiniudn.com/add:1426155649.643234:0','杨梅',5,0),(110,55,'葡萄干',1,0,0,10,3,1,'http://shopimg.qiniudn.com/add:1426155677.1115296:0','葡萄干',5,0),(111,55,'春卷',1,0,0,60,3,1,'http://shopimg.qiniudn.com/add:1426155712.9751625:0','春卷',5,0),(112,55,'小花片',1,0,0,60,3,1,'http://shopimg.qiniudn.com/add:1426155752.9407613:0','小花片',5,0),(113,51,'越南白心火龙果',1,0,0,50,2,1,'http://shopimg.qiniudn.com/add:1426155796.6863432:0','越南白心火龙果营养非常丰富，不仅含有一般植物少有的植物性白蛋白，还富含花青素，丰富的维生素，具有抗衰老，抗氧化，抗自由基，降低血糖，护肤润肠等攻效。',5,0),(114,55,'中花片',1,0,0,60,3,1,'http://shopimg.qiniudn.com/add:1426155784.2866442:0','中花片',5,0),(115,55,'黄金薯条',1,0,0,60,3,1,'http://shopimg.qiniudn.com/add:1426156195.9247057:0','黄金薯条',5,0),(116,55,'猕猴桃干',1,0,0,60,3,1,'http://shopimg.qiniudn.com/add:1426156228.958768:0','猕猴桃干',5,0),(117,55,'特级红枣',1,0,0,60,3,1,'http://shopimg.qiniudn.com/add:1426156264.563639:0','特级红枣',5,0),(118,55,'话梅',1,0,0,60,3,1,'http://shopimg.qiniudn.com/add:1426156337.8011856:0','话梅',5,0),(119,55,'金晶梅',1,0,0,60,3,1,'http://shopimg.qiniudn.com/add:1426156367.3872142:0','金晶梅',5,0),(120,55,'橄榄果',1,0,0,60,3,1,'http://shopimg.qiniudn.com/add:1426156406.2327583:0','橄榄果',5,0),(121,55,'榴莲饼',1,0,0,10,3,1,'http://shopimg.qiniudn.com/add:1426156475.0768015:0','榴莲饼',5,0),(122,56,'青椒',1,0,23,60,2,3,'http://shopimg.qiniudn.com/add:1426173941.2730768:0','青椒果实较大，辣味较淡。青椒能增强人的体力，缓解因工作、生活压力造成的疲劳。常食能增进食欲，帮助消化，促进肠蠕动，防止便秘。可以防治坏血病，对牙龈出血、贫血、血管脆弱有辅助治疗作用。',1,0),(123,56,'土豆',1,0,57,150,2,3,'http://shopimg.qiniudn.com/add:1426174257.0787733:0','土豆含有丰富的维生素及钙、钾等微量元素，且易于消化吸收，营养丰富。能供给人体大量的热能，人只靠马铃薯和全脂牛奶就足以维持生命和健康，土豆还具有和中养胃、健脾利湿、 降糖降脂、美容养颜、减肥等功效。',2,0),(124,56,'白萝卜',1,0,9,50,2,5,'http://shopimg.qiniudn.com/add:1426174567.674714:0','白萝卜是一种常见的蔬菜，生食熟食均可，其味略带辛辣味。它具有促进消化，增强食欲，加快胃肠蠕动和止咳化痰的作用。现代医学研究认为，白萝卜在临床实践中有一定的药用价值。',3,1),(125,56,'胡萝卜',1,0,9,50,2,3,'http://shopimg.qiniudn.com/mgoods:1426175920.237558:125','胡萝卜以质细味甜，脆嫩多汁，表皮光滑的为佳。它具有增强抵抗力、降糖降脂、明目、利膈宽肠等功效。\n一般人群均可食用。更适宜癌症、高血压、干眼症患者、营养不良、食欲不振者、皮肤粗糙者。脾胃虚寒者忌食。',5,0),(126,56,'黄瓜',1,0,15,50,2,5,'http://shopimg.qiniudn.com/add:1426175532.3650029:0','黄瓜中水分含量很高，也含有蛋白质，脂类，维生素等。它可以清热利水，解毒消肿，生津止渴。黄瓜主治发热口渴，咽喉肿痛，风热眼疾，湿热黄疸，小便不利等病症。',5,0),(127,57,'we',1,0,1212,12,1,5,NULL,'12w12w',1,3),(128,57,'111',1,86,87,25,1,5,NULL,'111',1,3),(129,57,'1',1,0,1,1,1,5,NULL,'1',1,2),(130,58,'sa',1,3,15,119,1,5,NULL,'12',1,2),(131,58,'DS',1,16,28,123218,1,5,NULL,'1',1,1),(132,59,'1',1,12,13,12111,1,5,NULL,'122',1,1);
