四五六七八九十一二三四五六七八九十'),(34,249,1,'妈妈再也不用担心吃水果的问题了','吃新鲜水果就在南理水果邦！'),(35,14,1,'新张试业大酬宾','试业期间，部分水果八折！！'),(36,189,1,'      开业通知','鲜果酷派即将迎来开业季，大家敬请期待'),(37,86,1,'水果驿站正式上线','内部测试中'),(38,287,1,'爆款草莓','爆款草莓'),(39,262,2,'招聘','招有识之士加入本帮！！'),(40,310,1,'小店现暂停营业，谢谢大家的支持','谢谢你们，我们会努力做得更好！'),(41,307,1,'小店配送范围！','小店只配送麻城市市区各小区  学校  单位  商业区！'),(42,344,1,'微信平台销售试营运公告','本店于2015年3月份开通微信平台水果销售渠道，3月到6月为试营运期间，所有水果优惠促销，欢迎选购。'),(43,360,1,'果萌，goodman','东升庙最专业的卖水果后生，只卖水果，而且只卖营养好吃的新鲜水果。'),(44,354,1,'3月15日正式开业','3月15日正式开业'),(45,311,1,'最新热销','新鲜蔬菜 天然雪山'),(46,340,1,'    点一下有惊喜！','新鲜包果，我们追求用户体验的极致，我们是你身边最懂你的小伙伴，我们是大鹰帝国最贴心的水果零食O2O创业团，Here we go~'),(47,245,1,'新店开张 大吉大利','新店开张 大吉大利'),(48,356,1,'隆重开门迎宾！','水果屋感谢森果科技技术支持，线上下单平台现已正式开门迎宾！'),(49,415,1,'开张！','凡在本店下单达18元立减现金！1至5元随机哦！'),(50,438,1,'新店开张，欢迎选购','新店开张，欢迎选购    \n                                --janson'),(51,406,1,'新鲜水果上线啦！点击进来看看吧','今天新上线了：香蕉，苹果，西红柿'),(52,450,1,'DUANG~~当我第一次','当我第一次想要开水果零食店微店的时候，其实我是，是怕怕的，我跟爸妈讲，我怕怕，因为，其实我，根本没有把握……爸妈跟我讲，我们给你加油，客户很少销量很少人做得很吃力……开了一个月微店之后呢，DUANG~~~销量棒棒升棒棒升。我现在呢，每天还是搬货，搬了很多货，销量，DUANG~~DUANG~~DUANG~~我的永嘉食货店，因为我，搬货……'),(53,453,1,'果果优品简介','果果优品微信移动购物平台，我们秉承健康，快时尚的服务理念，为企业会议、员工福利、高校学子，社区居民，都市白领等提供最超值快捷的水果订购、送货上门服务。爱上鲜果小妞，爱上高大上的鲜果。\n'),(54,453,2,'正在营业中......','欢迎光临，果果优品正在营业中......'),(55,391,1,'新店开张，优惠大赠送','新店开张，凡在规定日期内购买水果的小伙伴即可获得礼品赠送'),(56,334,1,'亲，欢迎来小店','亲们，欢迎来到小南微果蔬，在小店选购好后，我们给您送货上门，货到付款！试运营阶段！感谢您的关注与支持！');
